import { PanelLayout } from '@phosphor/widgets';
import { Widget } from '@phosphor/widgets';
import { IHistoryModel, HistoryModel } from './model';

// TODO(andrewhead): Delete this once we no longer need fake data.
import { CodeVersion, CodeVersionModel, ResultModel, SourceModel, SlicedCellModel } from '../codeversion';

/**
 * The class name added to history viewer widgets
 */
const HISTORY_VIEWER_CLASS = 'jp-HistoryViewer';

/**
 * A widget for showing the history of a result and how it was produced.
 */
export class HistoryViewer extends Widget {

    /**
     * Construct a new history viewer.
     */
    constructor(options: HistoryViewer.IOptions) {
        super();

        this.addClass(HISTORY_VIEWER_CLASS);
        this.id = 'livecells-revision-browser';
        this.title.label = 'Revision Browser';
        this.title.closable = true;

        // this._model = options.model;
        this._model = new HistoryModel({
            versions: [
                new CodeVersionModel({
                    versionIndex: 1,
                    timeCreated: "2018-07-06T09:29+00:00",
                    source: new SourceModel({
                        codeSlice: "%pylab inline\nimport os.path\nimport cv2\nTRAINING_DATA = 'lbpcascade_frontalface.xml'\nNEIGHBORS_NEEDED = 2\nDETECT_SCALING_FACTOR = 2\ndef find_faces_in_image(image_name, res=None):\n    image = cv2.imread(image_name)\n    grey = cv2.cvtColor(image, cv2.COLOR_BGR2GRAY)\n    face_cascade = cv2.CascadeClassifier()\n    face_cascade.load(TRAINING_DATA)\n    faces = face_cascade.detectMultiScale(grey, DETECT_SCALING_FACTOR, NEIGHBORS_NEEDED)\n    for face in faces:\n        l, t, w, h = face\n        cv2.rectangle(image, \n            (l, t),\n            (l + w, t + h), \n            (0, 255, 0), 10)\n    figure()  # make a new figure for each image\n    pyplot_img = image[:,:,[2,1,0]]  # Convert coloring to matplotlib RGB\n    imshow(pyplot_img)\nimgdir = os.path.join(os.getcwd(), 'snaps')\nfor image in os.listdir(imgdir):\n    find_faces_in_image(os.path.join(imgdir, image))",
                        cells: [
                            new SlicedCellModel({
                                cellId: 1,
                                executionCount: 6,
                                cellInSlice: true,
                                sourceOriginal: "%pylab inline\nimport os.path\nimport cv2",
                                slicedSource: "%pylab inline\nimport os.path\nimport cv2"
                            })
                        ]
                    }),
                    result: new ResultModel({
                        mimeType: "image/png",
                        data: "\n"
                    })
                })
            ]
        });

        let layout = (this.layout = new PanelLayout());
        for (let versionModel of this._model.versions) {
            layout.addWidget(new CodeVersion({ model: versionModel }));
        }
    }

    /**
     * Get the model used by the history viewer.
     */
    get model(): IHistoryModel {
        return this._model;
    }

    /**
     * Dispose of the resources used by the widget.
     */
    dispose() {
        if (this.isDisposed) {
            return;
        }
        this._model = null;
        super.dispose();
    }

    private _model: IHistoryModel = null;

}

/**
 * The namespace for the `HistoryViewer` class statics.
 */
export namespace HistoryViewer {
    /**
     * An options object for initializing a history viewer widget.
     */
    export interface IOptions {
        /**
         * The model used by the history viewer.
         */
        model: IHistoryModel;
    }
}